import { CLASS_NAME } from '../actions/types'
import ClaasJson from '../classroom_data.json'

const initialState = {
    ClaasJsonData: ClaasJson
}


export default function(state = initialState, action) {
    switch(action.type) {
        case CLASS_NAME: 
            return {
                ...state,
                markAverage: state.ClaasJsonData.map((data) => {data})
            }
    }
}
